import axios from "axios";
// "https://www.googleapis.com/books/v1/volumes?q=flowers+inauthor:keyes&key=AIzaSyDFxWzjKG_NCl6Gzlrl2spI6ALqfhAhlPU"
export default {
  search: function(query) {
    return axios.get(query);
  }
};
